<!doctype html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <link rel="stylesheet" href="./src/style/index.css">
  <meta name="viewport"
        content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Document</title>
  <script>
    const imageTextCreate = (text = 'Иван Иванович') => {
      const svgText = document.getElementById("svg_text");
      const form = document.getElementById("form_id");
      const certificateBlock = document.getElementById("certificate_block");
      certificateBlock.style.display = 'block'
      form.style.display = 'none'
      svgText.innerHTML = text;
    }

    const openCertificate = async (props) => {
      props.stopPropagation()
      const certificateBlock = document.getElementById("certificate_block");
      certificateBlock.style.display = 'none'
    }

    const showStudent = () => {
      const text = document.getElementById("fio_input");
      const certificateBlock = document.getElementById("certificate_block");
      certificateBlock.style.display = 'none'
      console.log(certificateBlock)
      imageTextCreate(text.value)
    }
  </script>
</head>
<body onload="openCertificate(event)">
<form
  id="form_id"
  onsubmit="event.stopPropagation(); showStudent(event); return false;">
  <div class="body__form">
    <div class="body__form_input">
      <span>Фио Ученика</span>
      <input id="fio_input" type="text">

    </div>
    <div>
      <button type="submit">Готово</button>
    </div>
  </div>
</form>
